import React, { useEffect, useState } from "react";



function App(){

    const [name,setname] = useState("Hello");
    const [isover,setmouseover] = useState(false);

    function Submit(){
        setname("Hello");
    }
    function handleover(){
        setmouseover(true);
    }
    function handleout(){
        setmouseover(false);
    }
    

 return (
    <div>
    <h1>{name}</h1>
    <input type="text" placeholder="What's Your Name" />
    <button style={{backgroundColor:isover ? "black" : "blue"}}
    onClick={Submit} 
    onMouseOver={handleover}
    onMouseOut={handleout}
    >
        Submit
    </button>
     
     
    </div>
   
 )
}
export default App;
